import React from 'react';
import './Task2.css';

const Task2 = () => {
  return (
    <div id="task2Container">

      {/* Main Section Starts */}

      <div id="mainSection">
        <div id="navSection">
          <div>
            <img src='https://university.adespresso.com/wp-content/themes/ae-brew-child/library/images/logo-university.png' alt='logo' style={{ width: "30%" }} />
            <div style={{ fontSize: "1.5vw" }}><button style={{ fontSize: "1.5vw", padding: "1vh 3vh", backgroundColor: "green", borderRadius: "1vh", color: "white", cursor: "pointer" }}>Subscribe</button> or <button style={{ fontSize: "1.5vw", padding: "1vh 3vh", backgroundColor: "#337ab7", borderRadius: "1vh", color: "white", cursor: "pointer" }}>Login</button></div>
          </div>
        </div>
        <div id="heroSection">
          <div>
            <h1>Want to make facebook advertising easy again?</h1>
            <h3>Welcome to AdEspresso University</h3>
          </div>
          <img src='https://university.adespresso.com/wp-content/themes/ae-brew-child/library/images/ico/dude-graduated.png' alt='dude_Graduated' />
        </div>
      </div>
      {/* Main Section Ends */}

    </div>
  )
}

export default Task2
